import Logo from '../Logo';
import LoginForm from '../LoginForm';

const Home = () => {
  return (
    <div className="a-container">
      <Logo />
      <p>Vul de lobbycode en teamnaam in om mee te doen met de Quiz!</p>
      <LoginForm />
    </div>
  );
};

export default Home;
